class Solution {

    /**
     * @param String $num
     * @return Integer
     */
    function minimumOperations($num) {
        $length = strlen($num);
        $minOps = $length; // Worst case: delete all digits
        for ($i = 0; $i < $length; $i++) {
            for ($j = $i + 1; $j < $length; $j++) {
                $lastTwoDigits = intval($num[$i] . $num[$j]);
                if ($lastTwoDigits % 25 == 0) {
                    // Operations = Total length - 2 (for the two digits) - (j - i - 1) (digits between i and j that are kept)
                    $minOps = min($minOps, $length - 2 - ($j - $i - 1));
                }
            }
        }
        return $minOps;
    }
}
